import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  & > .back {
    width: 100%;
    height: 100%;
    position: absolute;
    left: 0;
    top: 0;
    background-color: black;
    opacity: 0.5;
  }
`;
function Popup() {
  return (
    <Wrapper>
      <div className="back" />
    </Wrapper>
  );
}

export default Popup;
